import React, {useEffect, useState} from 'react';
import './App.css';

const App = () => {

  const APP_ID = '732d490f'; 
  const appKey = 'ea1d0f7d3b451a26e286a2715f9d4a23'; 
  const exampleSearch = `https://api.edamam.com/search?q=chicken&app_id=${APP_ID}&app_key=${appKey}`

  useEffect(() => {
    console.log("effects have been run")
  },[])

  const [counter, setCounter] = useState(0);

  return (
    <div className='App'>
      <form className='search-form'>
        <input className='search-bar' type='text'/>
        <button className='search-button' type='submit'>Search</button>
      </form>
      <h1 onClick={() => setCounter(counter + 1) }>{counter}</h1>
    </div>
  )
}

export default App;
